import React from 'react';
import Layout from '../../components/Layout';
import Header from '../../components/Header';
import mapboxgl from '!mapbox-gl';


mapboxgl.accessToken = 'pk.eyJ1IjoiaGljY3VwLXN0YWZmIiwiYSI6ImNsangxeHVkbzAyNmwzdHJ4cmJiYWZmMm4ifQ.yI4259jlMq2elDiT_uK1kg';

export default class Controll {

    constructor() {
        this.state = {
            lng: 2.35,
            lat: 48.85,
            zoom: 9
        };
        this.mapContainer = React.createRef();
    }

    componentDidMount() {
        history.pushState({}, "Area Admin", location.hash.substring(1));
        const { lng, lat, zoom } = this.state;
        const map = new mapboxgl.Map({
        container: this.mapContainer.current,
        style: 'mapbox://styles/mapbox/streets-v12',
        center: [lng, lat],
        zoom: zoom
        });
    }

    render () {
        <Layout>
              <div>
                <style jsx>{`
                    .map-container {
                        position: absolute;
                        width: 100%;
                        height: 100%;
                    }
                    `}</style>
                    <div ref={this.mapContainer} className="map-container" />
                </div>
            <title>Hik'UP Admin</title>
        </Layout>
    }
}
